@c_washington @sukritin330 @aviqnia I know bro ... but it was not a blowout as predicted by Pollsters. It was a very close fight. 
Betting odds for Trump was at one point 67% . While Pollsters put him at 10%. 

Ballot harvesting is the reason Trump lost. If there were only in-Person voting Trump would've won.

@a_centrism At minimum, unsolicited mail-in ballots enabled large-scale ballot-harvesting, enough to produce D margins they would not have gotten otherwise.

Sometimes harvests use ballots for real people who would not have voted, sometimes ballots for deceased or absent voters. 

Audits ...
